import Acordian from './Acordian'
import './All.css'

const accData = {
    itemGroup: [
        { id: 'A', country: 'Country A' },
        { id: 'B', country: 'Country B' }
    ],
    items: [
        { id: 'A', country: 'Afghanistan.' },
        { id: 'A', country: 'Armenia.' },
        { id: 'A', country: 'Argentina.' },
        { id: 'B', country: 'Bahrain.' },
        { id: 'B', country: 'Belgium.' },
        { id: 'B', country: 'Bangladesh.' },
    ]

}

function AccodianPage() {

    return (
        <div>
            {accData.itemGroup.map((item)=>{
                return <Acordian key={item.id} value={item}/>
            })}
            {/* <Acordian /> */}
        </div>
    )
}
export default AccodianPage
